import { useState } from 'react';
import {Container, Navbar, NavDropdown, Nav} from 'react-bootstrap/';
import SideNavBar from "./sideNavBar";

export default function Header(){

  const [colSize, setColSize] = useState({
    content: "",
    wrap: "",
  });
  const [sideNavClass, setSideNavClass] = useState("");

  function openNav() {
    setSideNavClass("sidenavOpen");
    document.getElementById("main").style.marginLeft = "100%";
    document.getElementById("mySidenav").style.width = "103%";
    if (
      /Android|webOS|iPhone|iPad|iPod|BlackBerry|IEMobile|Opera Mini/i.test(
        navigator.userAgent
      )
    ) {
      document.getElementsByClassName("sidenavContent")[0].style.width = "100%";
      setColSize({
        content: "12",
        wrap: "0",
      });
    } else {
      document.getElementsByClassName("sidenavContent")[0].style.width =
        "300px";
      setColSize({
        content: "",
        wrap: "",
      });
    }
  }

  /* Set the width of the side navigation to 0 and the left margin of the page content to 0, and the background color of body to white */
  function closeNav() {
    setSideNavClass("sidenavClose");
    setTimeout(() => {
    document.getElementById("mySidenav").style.width = "0";
    document.getElementById("main").style.marginLeft = "0";
    }, 200)
  }


    return <Navbar bg="" expand="lg">
    <Container>
      <Navbar.Brand href=""><img className="brandLogo" src="/logo.png"/></Navbar.Brand>
      <Navbar.Toggle aria-controls="basic-navbar-nav" />
      <Navbar.Collapse id="basic-navbar-nav">
        <Nav className="ms-auto">
          <Nav.Link className="interText" href="/">Map</Nav.Link>
          <Nav.Link className="interText" href="/list">List</Nav.Link>
          <Nav.Link className="interText" href="/about">About</Nav.Link>
          <Nav.Link className="interText" href="/contact">Contact</Nav.Link>
          <Nav.Link className="interText" href="/add">Add</Nav.Link>
        </Nav>
      </Navbar.Collapse>
    </Container>
    <SideNavBar />
  </Navbar>
}
